import {FaSignInAlt, FaSignOutAlt, FaUser} from 'react-icons/fa'
import { Link} from 'react-router-dom'


const Navbar = () => {
    return (
        <div>
            <Link to='/'>Banicja</Link>
            <Link to='/login'> <FaSignInAlt/> Sing In</Link>
            <Link to='/register'> <FaUser/> Sign up</Link>
            <Link to='/register'> <FaSignOutAlt/> Logout</Link>
        </div>
        
    )
} 
export default Navbar
